<p>一套用于<strong>构建用户界面</strong>的<strong>渐进式</strong> <code>JavaScript</code>框架</p>
<p><code>Vue</code>可以自底向上逐层的应用</p>
<ul>
<li>
<p>简单应用：只需一个轻量小巧的核心库</p>
</li>
<li>
<p>复杂应用：可以引入各式各样的<code>Vue</code>插件 <code>vue-router</code>,<code>vuex</code>.....</p>
</li>
</ul>
